let candle = record.current
let P = 14 //number of periods to analyse stochastic oscillator
let len = 10 //period for averaging at Normalization procedure
let L = 20 //period for dynqmic levels
let Up = 2 //
let Low = 2 //

variable.high.push(candle.max)
variable.low.push(candle.min)
variable.lastClose.push(candle.close)

if (variable.lastClose.length > P) {
	variable.high.splice(0, 1)
	variable.low.splice(0, 1)
	variable.lastClose.splice(0, 1)
}

if (variable.lastClose.length === P) {
	variable.hHigh = Math.max.apply(Math, variable.high)
	variable.lLow = Math.min.apply(Math, variable.low)
	variable.K = (candle.close - variable.lLow) / (variable.hHigh - variable.lLow) * 100
} else {
	variable.K = 50
}

if (isNaN(variable.K) || variable.K === undefined) {
	variable.K = 50
}

//Normalization procedure

variable.stoc.push(variable.K)
if (variable.stoc.length > len) {
	variable.stoc.splice(0, 1)
}
variable.sum = 0
if (variable.stoc.length === len) {
	for (var i = 0; i < len; i++) {
		variable.sum += variable.stoc[i]
	}
	variable.MA = variable.sum / len
} else {
	variable.MA = variable.K
}

variable.sumSQ = 0
if (variable.stoc.length === len) {
	for (var i = 0; i < len; i++) {
		variable.sumSQ += Math.pow(variable.stoc[i] - variable.MA, 2)
	}
	variable.sigma = Math.sqrt(variable.sumSQ / len)
} else {
	variable.sigma = variable.MA * 0.01
}

if (variable.sigma === 0) {
	variable.Z = 0
} else {
	variable.Z = (variable.K - variable.MA) / variable.sigma
}

//Normalized stochastic dynamic OB/OS levels

variable.lastZ.push(variable.Z)
if (variable.lastZ.length > L) {
	variable.lastZ.splice(0, 1)
}

variable.sumZ = 0
if (variable.lastZ.length === L) {
	for (var i = 0; i < L; i++) {
		variable.sumZ += variable.lastZ[i]
	}
	variable.maZ = variable.sumZ / L
} else {
	variable.maZ = variable.Z
}

variable.sumSQZ = 0

if (variable.lastZ.length === L) {
	for (var i = 0; i < L; i++) {
		variable.sumSQZ += Math.pow(variable.lastZ[i] - variable.maZ, 2)
	}
	variable.sigZ = Math.sqrt(variable.sumSQZ / L)
} else {
	variable.sigZ = 0.1 * variable.maZ
}

variable.upperZ = variable.maZ + Up * variable.sigZ
variable.lowerZ = variable.maZ - Low * variable.sigZ

